import { Link } from "react-router-dom";

const Navbar = () =>{
  return(
    <div className="navbar">
      <span className="logo">Dani App</span>
      <ul className="list">
          <li className="listItem">
            <img src="" alt="" className="avatar" />
          </li>
          <li className="listItem">Tatah </li>
      </ul>

    </div>
  )
}

export default Navbar;
